import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Summary() { // Component name matches PascalCase convention
  const [processedData, setProcessedData] = useState(null);
  const [message, setMessage] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const data = localStorage.getItem('processedData');
    if (data) {
      setProcessedData(JSON.parse(data));
    } else {
      setMessage('No processed data found. Please upload documents first.');
    }
  }, []);

  const handleSaveData = async () => {
    if (!processedData) {
      setMessage('No data to save.');
      return;
    }

    const token = localStorage.getItem('jwt_token');
    if (!token) {
      navigate('/login');
      return;
    }

    try {
      const response = await axios.post('http://127.0.0.1:5000/api/save_extracted_data', processedData, {
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`
        }
      });
      setMessage(response.data.message);
      // Clear processedData from local storage after saving (optional)
      localStorage.removeItem('processedData');
      // Navigate to history or home after saving
      navigate('/history');
    } catch (error) {
      console.error('Error saving data:', error);
      if (error.response) {
        setMessage(`Error: ${error.response.data.message || 'Failed to save data'}`);
        if (error.response.status === 401) {
          navigate('/login');
        }
      } else {
        setMessage('Error: Could not connect to the server.');
      }
    }
  };

  if (message && message.includes('No processed data found')) {
    return <div className="summary-container error-message">{message}</div>;
  }

  if (!processedData) {
    return <div className="summary-container">Loading summary...</div>;
  }

  const { aggregated_financial_data, final_tax_computation_summary, document_processing_summary } = processedData;

  return (
    <div className="summary-container">
      <h2>Tax Summary & Review</h2>
      {message && <p className="message">{message}</p>}

      <div className="summary-section">
        <h3>Document Processing Summary</h3>
        {document_processing_summary && document_processing_summary.length > 0 ? (
          <ul>
            {document_processing_summary.map((doc, index) => (
              <li key={index}>
                <strong>{doc.filename}:</strong> {doc.status} ({doc.message}) - Type: {doc.identified_type}
              </li>
            ))}
          </ul>
        ) : (
          <p>No document processing details available.</p>
        )}
      </div>

      <div className="summary-section">
        <h3>Aggregated Financial Data</h3>
        {aggregated_financial_data ? (
          <div className="data-grid">
            <div className="data-item"><strong>Name:</strong> {aggregated_financial_data.name || 'N/A'}</div>
            <div className="data-item"><strong>PAN:</strong> {aggregated_financial_data.pan || 'N/A'}</div>
            <div className="data-item"><strong>Aadhaar:</strong> {aggregated_financial_data.aadhaar || 'N/A'}</div>
            <div className="data-item"><strong>Date of Birth:</strong> {aggregated_financial_data.date_of_birth || 'N/A'}</div>
            <div className="data-item"><strong>Email:</strong> {aggregated_financial_data.email || 'N/A'}</div>
            <div className="data-item"><strong>Phone:</strong> {aggregated_financial_data.phone_number || 'N/A'}</div>
            <div className="data-item"><strong>Address:</strong> {aggregated_financial_data.address || 'N/A'}</div>
            <div className="data-item"><strong>Assessment Year:</strong> {aggregated_financial_data.assessment_year || 'N/A'}</div>
            <div className="data-item"><strong>Financial Year:</strong> {aggregated_financial_data.financial_year || 'N/A'}</div>
            
            <div className="data-item large"><strong>Total Gross Salary:</strong> ₹{aggregated_financial_data.total_gross_salary?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Exempt Allowances:</strong> ₹{aggregated_financial_data.exempt_allowances?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Professional Tax:</strong> ₹{aggregated_financial_data.professional_tax?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Income from House Property:</strong> ₹{aggregated_financial_data.income_from_house_property?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Interest on Housing Loan (24b):</strong> ₹{aggregated_financial_data.interest_on_housing_loan_24b?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Other Income (Savings Interest):</strong> ₹{aggregated_financial_data.other_income_interest_savings?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Other Income (FD Interest):</strong> ₹{aggregated_financial_data.other_income_interest_fd?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Other Income (Dividend):</strong> ₹{aggregated_financial_data.other_income_dividend?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Other Income (Misc):</strong> ₹{aggregated_financial_data.other_income_misc?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Capital Gains (Long Term):</strong> ₹{aggregated_financial_data.capital_gains_long_term?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Capital Gains (Short Term):</strong> ₹{aggregated_financial_data.capital_gains_short_term?.toFixed(2) || '0.00'}</div>
            <div className="data-item large highlight"><strong>Total Gross Income:</strong> ₹{aggregated_financial_data.total_gross_income?.toFixed(2) || '0.00'}</div>
            
            <div className="data-item large"><strong>Standard Deduction:</strong> ₹{aggregated_financial_data.standard_deduction?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>80C Deduction:</strong> ₹{aggregated_financial_data.deduction_80C?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>80CCD(1B) Deduction:</strong> ₹{aggregated_financial_data.deduction_80CCD1B?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>80D Deduction:</strong> ₹{aggregated_financial_data.deduction_80D?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>80G Deduction:</strong> ₹{aggregated_financial_data.deduction_80G?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>80TTA Deduction:</strong> ₹{aggregated_financial_data.deduction_80TTA?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>80TTB Deduction:</strong> ₹{aggregated_financial_data.deduction_80TTB?.toFixed(2) || '0.00'}</div>
            <div className="data-item large highlight"><strong>Total Deductions:</strong> ₹{aggregated_financial_data.total_deductions?.toFixed(2) || '0.00'}</div>
            
            <div className="data-item large"><strong>Total TDS:</strong> ₹{aggregated_financial_data.total_tds?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Advance Tax Paid:</strong> ₹{aggregated_financial_data.advance_tax?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Self-Assessment Tax Paid:</strong> ₹{aggregated_financial_data.self_assessment_tax?.toFixed(2) || '0.00'}</div>
          </div>
        ) : (
          <p>No aggregated financial data available.</p>
        )}
      </div>

      <div className="summary-section">
        <h3>Final Tax Computation Summary</h3>
        {final_tax_computation_summary ? (
          <div className="data-grid">
            <div className="data-item large"><strong>Calculated Gross Income:</strong> ₹{final_tax_computation_summary.calculated_gross_income?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Calculated Total Deductions:</strong> ₹{final_tax_computation_summary.calculated_total_deductions?.toFixed(2) || '0.00'}</div>
            <div className="data-item large highlight"><strong>Computed Taxable Income:</strong> ₹{final_tax_computation_summary.computed_taxable_income?.toFixed(2) || '0.00'}</div>
            <div className="data-item large highlight"><strong>Estimated Tax Payable:</strong> ₹{final_tax_computation_summary.estimated_tax_payable?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Total TDS Credit:</strong> ₹{final_tax_computation_summary.total_tds_credit?.toFixed(2) || '0.00'}</div>
            <div className="data-item large highlight-green"><strong>Refund Due from Tax:</strong> ₹{final_tax_computation_summary.refund_due_from_tax?.toFixed(2) || '0.00'}</div>
            <div className="data-item large highlight-red"><strong>Tax Due to Government:</strong> ₹{final_tax_computation_summary.tax_due_to_government?.toFixed(2) || '0.00'}</div>
            <div className="data-item large"><strong>Regime Consideration:</strong> {final_tax_computation_summary.regime_consideration || 'N/A'}</div>
            <div className="data-item full-width"><strong>Notes:</strong> {final_tax_computation_summary.notes || 'N/A'}</div>
          </div>
        ) : (
          <p>No final tax computation summary available.</p>
        )}
      </div>

      <div className="summary-actions">
        <button onClick={() => navigate('/suggestions')} className="button primary">
          Get Tax Suggestions
        </button>
        <button onClick={handleSaveData} className="button secondary">
          Save This Tax Record
        </button>
      </div>
    </div>
  );
}

export default Summary;
